(5, 4, 0, '購入者ガイド', '<h4 class="ml30 spml_0 mb10 f14 strong">1．まずは新規会員登録</h4>\r\n<p class="ml30 spml_0">新規会員登録は、必要事項を入力するだけでとても簡単です。<br>\r\n  登録したメールアドレスに届く登録認証メールをクリックし、完了します。 </p>\r\n<div>\r\n  <img src="https://imgur.com/MGswudO.png" alt="" class="guide_img">\r\n</div>\r\n<h4 class="ml30 spml_0 f14 strong">2．サイトにログイン</h4>\r\n<p class="ml30 spml_0 mb20">会員登録時に入力した登録情報（メールアドレスとパスワード）を入力し、\r\n  「ログイン」ボタンをクリックして、ログインして下さい。 </p>\r\n<div>\r\n  <img src="https://imgur.com/MGswudO.png" alt="" class="guide_img">\r\n</div>\r\n<h4 class="ml30 spml_0 f14 strong">3．購入したい商品をカートに入れて購入手続きを開始</h4>\r\n\r\n<p class="ml30 spml_0 mb20">購入希望商品を1点ずつ「カートに入れる」ボタンをクリックしてショッピングカートに入れます。\r\n  購入希望商品全てをカートに入れ終わりましたら、「カートの中」ボタンをクリックし、購入手続きに進みます。 </p>\r\n<div>\r\n  <img src="https://imgur.com/MGswudO.png" alt="" class="guide_img">\r\n</div>\r\n<h4 class="ml30 spml_0 f14 strong">4．カート内の商品を確認</h4>\r\n<p class="ml30 spml_0 mb20">カート内の商品を確認して下さい。<br>\r\n  もし必要のない商品がある場合はカートから削除して下さい。 </p>\r\n<div>\r\n  <img src="https://imgur.com/MGswudO.png" alt="" class="guide_img">\r\n</div>\r\n<h4 class="ml30 spml_0 mb10 f14 strong">5．ポイントをクレジット決済で追加</h4>\r\n<p class="ml30 spml_0 mb20">ポイント決済用のポイントをクレジット決済で追加します。\r\n  クレジットカードの情報は、入力方法に従って正確に入力して下さい。<br>\r\n  最後に「購入完了」ボタンをクリックすると、ポイントは追加されます。 </p>\r\n<div>\r\n  <img src="https://imgur.com/MGswudO.png" alt="" class="guide_img">\r\n</div>\r\n<h4 class="ml30 spml_0 f14 strong">6．商品をポイント決済</h4>\r\n<p class="ml30 spml_0 mb20">事前に購入されたポイントを使用して商品のポイント決済を行います。\r\n  ご注文のお支払金額合計を確認して下さい。<br>\r\n  問題がなければ、「購入手続きに進む」をクリックしてポイント決済ページへ進んで下さい。 </p>\r\n<div>\r\n  <img src="https://imgur.com/MGswudO.png" alt="" class="guide_img">\r\n</div>\r\n<h4 class="ml30 spml_0 mb10 f14 strong">7．購入した商品・サービスをそれぞれダウンロード</h4>\r\n<p class="ml30 spml_0 mb20">「マイページ」内の「注文履歴・購入商品」ページを開くと、購入商品のリストが表示されます。<br>\r\n  ダウンロード商品の場合はダウンロードを行い、サービス商品であれば出品者に購入済みの旨を伝え作業を開始してもらいます。 </p>\r\n<div>\r\n  <img src="https://imgur.com/MGswudO.png" alt="" class="guide_img">\r\n</div>', '<h4 class="ml30 spml_0 mb10 f14 strong">1．まずは新規会員登録</h4>\r\n<p class="ml30 spml_0">新規会員登録は、必要事項を入力するだけでとても簡単です。<br>\r\n  登録したメールアドレスに届く登録認証メールをクリックし、完了します。 </p>\r\n<div>\r\n  <img src="https://i.imgur.com/MGswudO.png" alt="" class="guide_img">\r\n</div>\r\n<h4 class="ml30 spml_0 f14 strong">2．サイトにログイン</h4>\r\n<p class="ml30 spml_0 mb20">会員登録時に入力した登録情報（メールアドレスとパスワード）を入力し、\r\n  「ログイン」ボタンをクリックして、ログインして下さい。 </p>\r\n<div>\r\n  <img src="https://i.imgur.com/MGswudO.png" alt="" class="guide_img">\r\n</div>\r\n<h4 class="ml30 spml_0 f14 strong">3．購入したい商品をカートに入れて購入手続きを開始</h4>\r\n\r\n<p class="ml30 spml_0 mb20">購入希望商品を1点ずつ「カートに入れる」ボタンをクリックしてショッピングカートに入れます。\r\n  購入希望商品全てをカートに入れ終わりましたら、「カートの中」ボタンをクリックし、購入手続きに進みます。 </p>\r\n<div>\r\n  <img src="https://i.imgur.com/MGswudO.png" alt="" class="guide_img">\r\n</div>\r\n<h4 class="ml30 spml_0 f14 strong">4．カート内の商品を確認</h4>\r\n<p class="ml30 spml_0 mb20">カート内の商品を確認して下さい。<br>\r\n  もし必要のない商品がある場合はカートから削除して下さい。 </p>\r\n<div>\r\n  <img src="https://i.imgur.com/MGswudO.png" alt="" class="guide_img">\r\n</div>\r\n<h4 class="ml30 spml_0 mb10 f14 strong">5．ポイントをクレジット決済で追加</h4>\r\n<p class="ml30 spml_0 mb20">ポイント決済用のポイントをクレジット決済で追加します。\r\n  クレジットカードの情報は、入力方法に従って正確に入力して下さい。<br>\r\n  最後に「購入完了」ボタンをクリックすると、ポイントは追加されます。 </p>\r\n<div>\r\n  <img src="https://i.imgur.com/MGswudO.png" alt="" class="guide_img">\r\n</div>\r\n<h4 class="ml30 spml_0 f14 strong">6．商品をポイント決済</h4>\r\n<p class="ml30 spml_0 mb20">事前に購入されたポイントを使用して商品のポイント決済を行います。\r\n  ご注文のお支払金額合計を確認して下さい。<br>\r\n  問題がなければ、「購入手続きに進む」をクリックしてポイント決済ページへ進んで下さい。 </p>\r\n<div>\r\n  <img src="https://i.imgur.com/MGswudO.png" alt="" class="guide_img">\r\n</div>\r\n<h4 class="ml30 spml_0 mb10 f14 strong">7．購入した商品・サービスを確認する</h4>\r\n<p class="ml30 spml_0 mb20">「マイページ」内の「注文履歴・購入商品」ページを開くと、購入商品のリストが表示されます。<br>\r\n  購入した商品が出品者によって、事前に会員登録時の住所に発送されます。<br>\r\n受け取り後、「ステータス」の部分に「受け取りしました」ボタンが表示されますので、受け取りボタンを押して取引完了となります。</p>', '0000-00-00 00:00:00', '2018-11-26 11:51:41'),
(6, 5, 0, '出品者ガイド', '<h4 class="ml30 spml_0 mb10 f14 strong">1．まずは新規会員登録</h4>\r\n<p class="ml30 spml_0">新規会員登録は、必要事項を入力するだけでとても簡単です。<br>\r\n  登録したメールアドレスに届く登録認証メールをクリックし、完了します。 </p>\r\n<div>\r\n  <img src="https://imgur.com/UUvLz0T.png" alt="" class="guide_img">\r\n</div>\r\n<h4 class="ml30 spml_0 f14 strong">2．サイトにログイン</h4>\r\n<p class="ml30 spml_0 mb20">会員登録時に入力した登録情報（メールアドレスとパスワード）を入力し、\r\n  「ログイン」ボタンをクリックして、ログインして下さい。 </p>\r\n<div>\r\n  <img src="https://imgur.com/UUvLz0T.png" alt="" class="guide_img">\r\n</div>\r\n<h4 class="ml30 spml_0 f14 strong">3．出品したい商品やサービスを登録する</h4>\r\n<p class="ml30 spml_0 mb20">左カラムの「商品を出品する」から商品の登録を開始します。<br>\r\n  出品したい商品名や詳細情報を記入し誓約事項確認をよく確認しチェック入れ出品を完了します。</p>\r\n<div>\r\n  <img src="https://imgur.com/UUvLz0T.png" alt="" class="guide_img">\r\n</div>\r\n<h4 class="ml30 spml_0 f14 strong">4．商品が購入される</h4>\r\n<p class="ml30 spml_0 mb20">商品が購入された場合、ダウンロード商品はすでに登録済みの場合はそのままでも構いません。<br>\r\n  スキルシェアなどのサービス商品であれば作業を行ないます。<br>\r\n  この場合、購入者とヒアリングを行った上でサービス完了を目指してください。</p>\r\n<div>\r\n  <img src="https://imgur.com/UUvLz0T.png" alt="" class="guide_img">\r\n</div>\r\n<h4 class="ml30 spml_0 f14 strong">5．換金申請の準備をする</h4>\r\n<p class="ml30 spml_0 mb20">「マイページ」の「登録情報」から会員登録内容を変更します。<br>\r\n  振込先口座情報を記入し換金申請へ進みます。</p>\r\n<div>\r\n  <img src="https://imgur.com/UUvLz0T.png" alt="" class="guide_img">\r\n</div>\r\n<h4 class="ml30 spml_0 f14 strong">6．換金申請をする</h4>\r\n<p class="ml30 spml_0 mb20">「マイページ」の「売上管理」から換金申請を行います。<br>\r\n  売り上げ金額が「換金申請できる金額」に到達している場合、換金申請が行えます。</p>\r\n<div>\r\n  <img src="https://imgur.com/UUvLz0T.png" alt="" class="guide_img">\r\n</div>', '<h4 class="ml30 spml_0 mb10 f14 strong">1．まずは新規会員登録</h4>\r\n<p class="ml30 spml_0">新規会員登録は、必要事項を入力するだけでとても簡単です。<br>\r\n  登録したメールアドレスに届く登録認証メールをクリックし、完了します。 </p>\r\n<div>\r\n  <img src="https://i.imgur.com/UUvLz0T.png" alt="" class="guide_img">\r\n</div>\r\n<h4 class="ml30 spml_0 f14 strong">2．サイトにログイン</h4>\r\n<p class="ml30 spml_0 mb20">会員登録時に入力した登録情報（メールアドレスとパスワード）を入力し、\r\n  「ログイン」ボタンをクリックして、ログインして下さい。 </p>\r\n<div>\r\n  <img src="https://i.imgur.com/UUvLz0T.png" alt="" class="guide_img">\r\n</div>\r\n<h4 class="ml30 spml_0 f14 strong">3．出品したい商品やサービスを登録する</h4>\r\n<p class="ml30 spml_0 mb20">左カラムの「商品を出品する」から商品の登録を開始します。<br>\r\n  出品したい商品名や詳細情報を記入し誓約事項確認をよく確認しチェック入れ出品を完了します。</p>\r\n<div>\r\n  <img src="https://i.imgur.com/UUvLz0T.png" alt="" class="guide_img">\r\n</div>\r\n<h4 class="ml30 spml_0 f14 strong">4．商品が購入される</h4>\r\n<p class="ml30 spml_0 mb20">商品が購入された場合、出品者の住所をDMで問い合わせて商品を発送します。<br>\r\n  この際、注文処理で「発送しました」ボタンを必ず押します。<br>\r\n  商品が届き次第、購入者から「受け取りました」ボタンを押されると取引成立です。</p>\r\n<div>\r\n  <img src="https://i.imgur.com/UUvLz0T.png" alt="" class="guide_img">\r\n</div>\r\n<h4 class="ml30 spml_0 f14 strong">5．換金申請の準備をする</h4>\r\n<p class="ml30 spml_0 mb20">購入者との取引が完了すると、手数料を引かれたポイントがマイページに反映されます。<br>\r\nそして、次に換金申請の準備をします。<br>\r\n「マイページ」の「登録情報」から会員登録内容を変更します。<br>\r\n  振込先口座情報を記入し換金申請へ進みます。</p>\r\n<div>\r\n  <img src="https://i.imgur.com/UUvLz0T.png" alt="" class="guide_img">\r\n</div>\r\n<h4 class="ml30 spml_0 f14 strong">6．換金申請をする</h4>\r\n<p class="ml30 spml_0 mb20">「マイページ」の「売上管理」から換金申請を行います。<br>\r\n  売り上げ金額が「換金申請できる金額」に到達している場合、換金申請が行えます。</p>\r\n<div>\r\n  <img src="https://i.imgur.com/UUvLz0T.png" alt="" class="guide_img">\r\n</div>', '0000-00-00 00:00:00', '2018-11-26 11:52:29'),
(7, 6, 0, 'よくある質問', '<div id="sub" class="col-xs-12 col-sm-12 col-md-12 m60">\r\n  <p class="title">Q. ここに質問が入ります</p>\r\n  <p>A. ここにアンサーが入ります。</p>\r\n  <p class="title">Q. ここに質問が入ります</p>\r\n  <p>A. ここにアンサーが入ります。</p>\r\n  <p class="title">Q. ここに質問が入ります</p>\r\n  <p>A. ここにアンサーが入ります。</p>\r\n  <p class="title">Q. ここに質問が入ります</p>\r\n  <p>A. ここにアンサーが入ります。</p>\r\n  <p class="title">Q. ここに質問が入ります</p>\r\n  <p>A. ここにアンサーが入ります。</p>\r\n  <p class="title">Q. ここに質問が入ります</p>\r\n  <p>A. ここにアンサーが入ります。</p>\r\n  <p class="title">Q. ここに質問が入ります</p>\r\n  <p>A. ここにアンサーが入ります。</p>\r\n  <p class="title">Q. ここに質問が入ります</p>\r\n  <p>A. ここにアンサーが入ります。</p>\r\n  <p class="title">Q. ここに質問が入ります</p>\r\n  <p>A. ここにアンサーが入ります。</p>\r\n  <p class="title">Q. ここに質問が入ります</p>\r\n  <p>A. ここにアンサーが入ります。</p>\r\n  <p class="title">Q. ここに質問が入ります</p>\r\n  <p>A. ここにアンサーが入ります。</p>\r\n</div>', '<div id="sub" class="col-xs-12 col-sm-12 col-md-12 m60">\r\n  <p class="title">Q. 出品中の商品はいつまで買えますか？</p>\r\n  <p>A. 購入されるまで掲載され、出品者が非公開にしない限り購入可能です。</p>\r\n  <p class="title">Q. 現在取引している商品をキャンセルしたいのですがどうしたらいいですか？</p>\r\n  <p>A. 一度、購入されたものは基本的にはキャンセルができません。<br>やむを得ない事情の場合は、一度運営事務局にお問い合わせください。</p>\r\n  <p class="title">Q. 売り上げの料率はどうなっていますか？</p>\r\n  <p>A. 20％が手数料となっております。</p>\r\n  <p class="title">Q. いつ振り込まれますか？</p>\r\n  <p>A. 月末締め翌月末支払いとなります。</p>\r\n  <p class="title">Q. 誤った口座を入力して換金申請をしてしまいました、どうしたらいいですか？</p>\r\n  <p>A. 運営事務局で確認しますので、一度お問い合わせください。</p>\r\n  <p class="title">Q. 退会後の個人情報はどうなりますか？</p>\r\n  <p>A. 運営事務局で、適宜データを削除しておりますのでご安心ください。</p>\r\n  <p class="title">Q. 利用するにあたってかかる費用はありますか？</p>\r\n  <p>A. 商品を買うまで、商品が売れるまではかかる費用は一切ございません。<br>\r\n商品が売れた場合にのみ手数料を引いた額がポイントとして支給されますので、換金申請を行い現金化をしてください。</p>\r\n</div>', '0000-00-00 00:00:00', '2019-05-30 16:22:03'),
