(10, 9, 0, '個人情報保護について', '<div class="mt20 ml20 pl20 spml_0 sppl_0">\r\n  <p class="f14 mt10">Mallento デモサイトでは個人情報の重要性を確認し、以下の取り組みを実施いたしており</p>\r\n  <p>(1) Mallento デモサイトでは、お客様個人に関する情報（以下「個人情報」といいます。」を館</p>\r\n  <p>(2) ユーザーの皆様から個人情報を取得させていただく場合は、利用目的をできる限り</p>\r\n  <p>(3) Mallento デモサイトでは、お客様より取得させていただいた個人情報を適切に管理し、以 </p>\r\n  <p class="ml15">(a)「※この商品を購入すると、ダウンロード会員の氏名がアップロード会員に開示</p>\r\n  <p class="ml15">(b)「※この商品を購入すると、ダウンロード会員のEメールアドレスがアップロー </p>\r\n  <p class="ml15">(c) 商品の購入後、ダウンロード会員の意思で、該商品のアップロード会員にダウン...</p>\r\n  <p class="ml15">※ 利用規約文章は管理画面のページ・CSS編集より編集いただけます。</p>\r\n</div>', '<div class="mt20 ml20 pl20 spml_0 sppl_0">\r\n  <p>furimo（以下：当サイト）における個人情報の取得は、当サイトで提供する<br>\r\nサービスの充実ならびに円滑な提供(提携事業者によるサービスの提供を含む)および<br>\r\n当サイトの円滑な運営を目的としその目的の達成に必要な範囲内で行います。</p>\r\n  <p>取得した個人情報は取得目的の範囲内で利用し、これらの目的以外で利用する場合には<br>\r\n　利用者に対し事前に確認、または同意を求めます。</p>\r\n  <p>個人情報の取得は当サイト上での入力により取得を行います。<br>\r\n　当サイト上での個人情報の取得にあたっては、登録時の確認アイコン等へのクリックによって<br>\r\n　ユーザー本人の同意を得たものとします。</p>\r\n\r\n  <p>当サイトでは、次のいずれかに該当する場合を除き、個人情報を第三者の開示・提供いたしません。</p>\r\n  <p class="ml15">〇ご本人の同意がある場合</p>\r\n  <p class="ml15">〇人の生命・身体または財産の保護のために必要な場合で当て、緊急を要するなど<br>\r\n　　ご本人の同意を得ることが困難である場合。</p>\r\n  <p class="ml15">〇国の機関もしくは地方公共団体またはその委託を受けた者が<br>\r\n　　法令の定める事務を遂行することに対して協力する必要がある場合であって<br>\r\n　　ご本人の同意を得ることにより当該事務の遂行に支障を及ぼす恐れがある場合。</p>\r\n  <p class="ml15">〇事業の継承に伴って、個人情報を提供する場合</p>\r\n  <p class="ml15">〇利用目的の達成に必要な範囲内において、業務委託先に開示または提供する場合<br>\r\n　　※この場合は、個人情報の取り扱いに関する契約の締結等により<br>\r\n　　　当該業務委託先において個人情報の適切な取り扱いが確保されるよう<br>\r\n　　　必要かつ適切な監督を行います。</p>\r\n  <p class="ml15">〇その他、法令等に基づき第三者に対する開示または提供が許される場合</p>\r\n</div>', '0000-00-00 00:00:00', '2018-11-26 11:54:30'),
