(109, 100, '１０年後に食える仕事食えない仕事　ＡＩ、ロボット化で変わる職のカタチ', 1650, NULL, '本', '【出版社名】\r\n東洋経済新報社\r\n\r\n【出版年月】\r\n2020年3月\r\n\r\n【JAN(ISBN)】\r\n9784492261149 \r\n\r\n【頁数・縦 】\r\n３３４Ｐ　２１ｃｍ\r\n\r\n【商品説明】\r\n大ヒットした前著から８年！ＡＩやブロックチェーンなど新しい仕事領域が登場する中、失敗しない仕事選びとは？「ＡＩやロボットに仕事が奪われる？」と不安でいっぱいのあなた。これを読めば、自分の将来が見渡せるようになります。　　 ITを中心とするテクノロジーの進化で、日本人の仕事は大きく変化しています。AI時代に生き残る仕事、人間が能力を発揮できる仕事とは？　本著は、著者の膨大な取材に基づき、リアル近未来の職業像を図解も交え徹底解説！将来を考え始めた10代、就職活動を控えた20代、転職チャンスをうかがう30代、第２の人生の仕事選びを考える40代、子供の将来を憂う50～60代、すべての人に必読の１冊です。　　 【仕事の未来を５カテゴリに分類して解説！】ロボティクス失業――機械やITに置き換わり、失業リスクが高い　手先ジョブ――人間の手先が必要不可欠で、永遠に残り続ける　職人プレミアム――テクノロジーとは無縁で、雇用は安定　AI・ブロックチェーン失業――中核業務は無人化・自動化が不可避　デジタル・ケンタウロス――AIを乗りこなし、人間の強みを発揮　　 【「AI化で消える仕事、残る仕事」マップ付き】\r\n', 'ご購入有難うございました。', '', NULL, NULL, '', '', '', '', '', 'コメント_2020_07_17_232733.jpg', 'コメント_2020_07_17_232733.jpg', '', '', '', NULL, NULL, NULL, NULL, NULL, 1, 0, 0, 0, 0, 1, 0, 1, NULL, '2020-07-17 23:24:59', '2020-07-17 23:29:06'),
